let initialState ={
    Express_main: [
            {id: '/express/calculate',title:'Калькулятор' , active: 'classes.active'},
            {id: '/express/users', title:'Мои отправления', active: 'classes.active'},
            {id: '/express/my_shipments', title:'Счета и оплата', active: 'classes.active'},
            {id: '/express/my_address', title:'Мои контакты', active: 'classes.active'},
    ],
        Cargo_main: [
            {id: '/car',title:'РќР°Р№С‚Рё РјР°С€РёРЅС‹' , active: 'classes.active'},
            {id: '/cargo', title:'РќР°Р№С‚Рё РіСЂСѓР·С‹', active: 'classes.active'},
            {id: '/my_car', title:'РњРѕРё РјР°С€РёРЅС‹', active: 'classes.active'},
            {id: '/my_cargo', title:'РњРѕРё РіСЂСѓР·С‹', active: 'classes.active'},
            {id: '/my_contact', title:'РњРѕРё Р°РґСЂРµСЃР° Рё РєРѕРЅС‚Р°РєС‚С‹', active: 'classes.active'},
]
};
const SidebarReducer = (state = initialState, action)=>
{
    return state;
}

export default SidebarReducer;
